          <thead style={{ background: "#ddf4ff" }}>
            <tr>
              <th
                style={{
                  border: "1px solid #a6d9ff",
                  borderRadius: "5px 5px 0 0",
                }}
                scope="col"
              >
                sai siass
              </th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td
                style={{
                  border: "1px solid #a6d9ff",
                  borderRadius: "0 0 5px 5px",
                }}
                scope="row"
              >
                Comment
              </td>
            </tr>
          </tbody>
        </table>
      </div>
    </React.Fragment>
  );
};

export default Comments;
